import React, { Component, Fragment } from 'react'
import ReviewForm from './ReviewForm'

class RestaurantInfo extends Component {


    render() {
        console.log(this.props.currentCard.result)
        return (
            <div className="d-flex justify-content-center">
                <div>
                    <h1>Name: {this.props.currentCard.result.name}</h1>
                    <h2>Rating: {this.props.currentCard.result.rating}</h2>
                    <h3>Address: {this.props.currentCard.result.formatted_address}</h3>
                    <h3>Phone number: {this.props.currentCard.result.formatted_phone_number}</h3>
                    <h3>Website: {this.props.currentCard.result.website}</h3>
                    <button></button>
                </div>

            </div>
        )
    }
}

export default RestaurantInfo
